import { createContext, useState } from "react";

// Create the context
export const Your_Session_Context = createContext();

export const Your_Session_Provider = ({ children }) => {
    const [myData, setMyData] = useState([]);
    // const [feedback, setFeedback] = useState('');

    return (
        <Your_Session_Context.Provider
            value={{
                myData,
                setMyData
            }}
        >
            {children}
        </Your_Session_Context.Provider>
    );
};
